local msgGroups = { GlobalMsg = { group = GlobalMsg, }, PhaseMsg = { group = PhaseMsg, prefix = PHASE_MESSAGE_PREFIX, }, }
do
    local nextMsgId = 1
    local usedMsgNames = {}
    for k, v in pairs(msgGroups) do
        v.msgIds = {}
        for _, msg in pairs(v.group) do
            local valid = true
            if UNITY_EDITOR or DEVELOPMENT_BUILD then
                if v.prefix and not string.startWith(msg, v.prefix) then
                    logger.error("Msg Prefix Error", k, msg, v.prefix)
                    valid = false
