                local id = nextMsgId
                nextMsgId = nextMsgId + 1
                msgs[msg] = id
                msgNames[id] = msg
                usedMsgNames[msg] = true
                v.msgIds[id] = true
            end
        end
    end
    logger.info("Msg Check Finished")
end
